import styled from "styled-components";
import { Fade } from "react-reveal";
import { useState } from "react";

function CustomTime() {
  return (
    <Container>
      <Fade bottom duration={250}>
        <TimeInput>
          <CloseTimeInput src="icons/close.png" className="cyan-icon"/>
          <TimeInputUI>
            <MinuteBlock></MinuteBlock> 
            <span>:</span>
            <SecondBlock></SecondBlock>
          </TimeInputUI>
        </TimeInput>
      </Fade>
    </Container>
  );
}

